    return (


    <div className="wrapper" id='promotion'>
        <div className="promotion">
            <h2>Акции</h2>
            <div className="grid">

                <a href="#banner1" className='popup_link'><img alt="" data-src="img/баннеры/1.png"
                                                               className="lazy"/></a>
                <a href="#banner2" className='popup_link'><img alt="" data-src="img/баннеры/2.png"
