                                                               className="lazy"/></a>
                <a href="#banner5" className='popup_link'><img alt="" data-src="img/баннеры/5.png"
                                                               className="lazy"/></a>
                <a href="#banner6" className='popup_link'><img alt="" data-src="img/баннеры/6.png"
                                                               className="lazy"/></a>
                <a href="#banner7" className='popup_link'><img alt="" data-src="img/баннеры/7.png"
                                                               className="lazy"/></a>
                <a href="#banner8" className='popup_link'><img alt="" data-src="img/баннеры/8.png"
                                                               className="lazy"/></a>
            </div>
        </div>
    </div>
    );
}

export default Index;
